import axios from './axiosInstance';

const incidentsAPI = {
  getAll: async () => {
    const res = await axios.get('/incidents');
    return res.data;
  },
  create: async (incident, token) => {
    const res = await axios.post('/incidents', incident, {
      headers: { Authorization: `Bearer ${token}` }
    });
    return res.data;
  }
};

export default incidentsAPI;
